#
# Structure for table "karyawan"
#

DROP TABLE IF EXISTS `karyawan`;
CREATE TABLE `karyawan` (
  `nik` char(16) NOT NULL DEFAULT '',
  `nama_depan` varchar(35) NOT NULL DEFAULT '',
  `nama_belakang` varchar(35) DEFAULT NULL,
  `jabatan` varchar(10) NOT NULL DEFAULT '' COMMENT '0=manager,1=staff',
  `alamat` text NOT NULL,
  `telpon` varchar(30) NOT NULL DEFAULT '',
  `email` varchar(40) NOT NULL DEFAULT '',
  `password` varchar(150) NOT NULL DEFAULT '',
  `tempat_lahir` varchar(30) NOT NULL DEFAULT '',
  `tanggal_lahir` char(20) NOT NULL DEFAULT '',
  `jenis_kelamin` varchar(10) NOT NULL DEFAULT '' COMMENT '0=laki-laki,1=perempuan',
  `status` varchar(10) NOT NULL DEFAULT '' COMMENT '0=lajang,1=menikah',
  `pendidikan_terakhir` enum('SD','SMP','SMA','SMK','MA','D3','S1','S2','S3','PROF') NOT NULL DEFAULT 'SD',
  `gaji` int(8) NOT NULL DEFAULT '0',
  `foto` varchar(100) NOT NULL DEFAULT '',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`nik`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC;

