#
# Structure for table "transaksi"
#

DROP TABLE IF EXISTS `transaksi`;
CREATE TABLE `transaksi` (
  `kode_transaksi` int(11) NOT NULL AUTO_INCREMENT,
  `nik` varchar(16) NOT NULL DEFAULT '',
  `nama_customer` varchar(50) NOT NULL DEFAULT '',
  `nomor_meja` int(2) NOT NULL DEFAULT '0',
  `uang_dibayarkan` int(8) NOT NULL DEFAULT '0',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`kode_transaksi`),
  KEY `Foreign Key` (`nik`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC;

